private GameObject ObjectPool(GameObject obj)
{
    GameObject container = new GameObject("ObjectPool");
    obj.transform.SetParent(container.transform);
    obj.SetActive(false);
    return obj;
}

private GameObject GetObjectFromPool(GameObject obj)
{
    foreach (Transform child in obj.transform.parent)
    {
        if (!child.gameObject.activeSelf)
        {
            child.gameObject.SetActive(true);
            return child.gameObject;
        }
    }
    GameObject newObj = Instantiate(obj);
    newObj.transform.SetParent(obj.transform.parent);
    newObj.SetActive(true);
    return newObj;
}

private void ReturnObjectToPool(GameObject obj)
{
    obj.SetActive(false);
}

